import { reqGetCode, reqRegisterCom } from '@/api'

const state = {
  code: [],
}
const mutations = {
  REQGETCODE(state, code) {
    state.code = code
  },
}

const getters = {}
const actions = {
  async reqCode({ commit }, phoneNUmber) {
    let result = await reqGetCode(phoneNUmber)
    if (result.code === 200) {
      commit('REQGETCODE', result.data)
    } else {
      return Promise.reject(new Error('fail'))
    }
  },
  async reqGetRegisterCom({ commit }, data) {
    let result = await reqRegisterCom(data)
    if (result.code === 200) {
      console.log(result)
    } else {
      return Promise.reject(new Error('fail'))
    }
  },
}

export default {
  state,
  mutations,
  getters,
  actions,
}
